import { Routes, Route, Outlet } from 'react-router-dom';

import Home from './routes/home/home.component';

const Navigation = () => {
  return(
    <>
      <div>
        <h2>Navigation</h2>
      </div>
      <Outlet/>
    </>
  );
}

const App = () => {
  return (
    <Routes>
      <Route path='/' element={Navigation }>
        <Route path='/' index element={<Home />} />
      </Route>

    </Routes>
  );
};

export default App;
